import React, { Component } from 'react';
import { Card as Base } from '@material-ui/core';
import PropTypes from 'prop-types';

function listItems(itemArray) {
  itemArray.map((itemArray) => <li>{itemArray}</li>)
}

class ListCard extends Component {

  render() {
    return (
      <Base>
        <div>
          <h1>{this.props.cardHeader}</h1>
        </div>
        <div>
          <ul>
            {this.props.cardItems}
          </ul>
        </div>
      </Base>
    );
  }
}

ListCard.propTypes = {
  cardHeader: PropTypes.string,
  cardItems: PropTypes.arrayOf(PropTypes.string)
};

ListCard.defaultProps = {
  cardHeader: 'Header',
  cardItems: ['item1', 'item2', 'item3']
};

export default ListCard;
